import React from 'react';

const WhyChooseUs = ({ features = defaultFeatures }) => {
  return (
    <div className="container-fluid py-5" style={{ background: '#fff', minHeight: '100vh' }}>
      <div className="container">
        <div className="row">
          <div className="col-12">
            <div className="d-flex flex-column">
              <div 
                className="px-4 py-2 mb-4 d-inline-flex" 
                style={{ 
                  background: '#1572d31a', 
                  borderRadius: '8px',
                  width: 'fit-content'
                }}
              >
                <span style={{ 
                  color: '#1572d3', 
                  fontWeight: 700, 
                  fontSize: '14px'
                }}>
                  НАШИТЕ ОСЛУГИ
                </span>
              </div>

              <h2 className="mb-5" style={{ 
                fontSize: '32px',
                fontWeight: 500,
                color: '#333',
                maxWidth: '670px'
              }}>
                Ние предлагаме най-качествените ослуги на пазара!
              </h2>
            </div>
          </div>
        </div>

        <div className="row">
          <div className="col-md-6">
            <img 
              src="https://dashboard.codeparrot.ai/api/image/Z7UBSTO_YEiK214d/audi-1.png"
              alt="Audi"
              className="img-fluid"
              style={{ maxWidth: '100%', height: 'auto' }}
            />
          </div>

          <div className="col-md-6">
            <div className="d-flex flex-column gap-4">
              {features.map((feature, index) => (
                <div key={index} className="d-flex align-items-start gap-4">
                  <div style={{
                    width: '64px',
                    height: '64px',
                    background: '#ecf5ff',
                    borderRadius: '16px',
                    display: 'flex',
                    alignItems: 'center',
                    justifyContent: 'center'
                  }}>
                    <img 
                      src={feature.icon}
                      alt={feature.title}
                      style={{ width: '24px', height: '24px' }}
                    />
                  </div>

                  <div className="d-flex flex-column">
                    <h3 style={{
                      fontSize: '20px',
                      fontWeight: 500,
                      marginBottom: '8px',
                      color: '#000'
                    }}>
                      {feature.title}
                    </h3>
                    <p style={{
                      fontSize: '16px',
                      color: '#6d6d6d',
                      margin: 0
                    }}>
                      {feature.description}
                    </p>
                  </div>
                </div>
              ))}
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

const defaultFeatures = [
  {
    icon: "https://dashboard.codeparrot.ai/api/image/Z7UBSTO_YEiK214d/vuesax-b-5.png",
    title: "Best price guaranteed",
    description: "Find a lower price? We'll refund you 100% of the difference."
  },
  {
    icon: "https://dashboard.codeparrot.ai/api/image/Z7UBSTO_YEiK214d/vuesax-b-6.png",
    title: "Experience driver",
    description: "Don't have driver? Don't worry, we have many experienced driver for you."
  },
  {
    icon: "https://dashboard.codeparrot.ai/api/image/Z7UBSTO_YEiK214d/vuesax-b-7.png",
    title: "24 hour car delivery",
    description: "Book your car anytime and we will deliver it directly to you."
  },
  {
    icon: "https://dashboard.codeparrot.ai/api/image/Z7UBSTO_YEiK214d/vuesax-b-8.png",
    title: "24/7 technical support",
    description: "Have a question? Contact Rentcars support any time when you have problem."
  }
];

export default WhyChooseUs;
